export default function Header() {
    return (
        <div className="header-wrapper">
        <div className="text-wrapper">
            <p><span>---</span><span>Your</span><span>Personal</span><span>Recipes</span><span>---</span></p>
            <p>Manage your own recipe collections</p>
        </div>


        </div>
    )
}
